import Index from './pages/index';
import About from './pages/about';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
function App() {
	return (
		<div className="App">
			<Router>
				<Routes>
					<Route path="/" element={<Index />} />
				</Routes>
			</Router>
			<Index />
		</div>
	);
}

export default App;
